import React from "react"
import { Player } from 'video-react';


function Vplayer () {
  let video = "videos/01.mp4"
  let play = true

  function handleEnd () {
    video = "videos/02.mp4"
    play = false
    play = true
  }
  return (
    <>
        <Player
          controls={false}
          playing={play}
          playsInline
          fluid={true}
          autoPlay
          style={{display: 'none'}}
          src={video}
          onEnded={(handleEnd)}
        />
    </>
  )
}

export default Vplayer
